import ProductsList from './components/mainpage/productslist';
import Navbar from './pages/navbar';


const App = () => {
 return(
  <div>
  <Navbar />
   <BrowserRouter>
   <Routes>


      <Route path="/" element={<ProductsList />} />
      <Route path='/addproduct' element={<AddProduct />} />
   </Routes>
   </BrowserRouter>
   </div>
 ) 

}

export default App;
